import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

// layout
import Navar from './components/layout/NavBar'
import Footer from './components/layout/Footer'

// pages
import Home from "./components/pages/Home"
import Destinos from './components/pages/Destinos'
import Promocoes from './components/pages/Promocoes'
import AtendimentoContato from './components/pages/AtendimentoContato'
import Pessoas from './components/pages/Pessoas'

function App() {
return (
    <>
    <Router>
        <Navbar />
        <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/Destinos" element={<Destinos />} />
            <Route path="/Promocoes" element={<Promocoes />} />
            <Route path="/AtendimentoContato" element={<AtendimentoContato />} />
            <Route path="/Pessoas" element={<Pessoas />} />
        </Routes>
        <Footer /> 
    </Router>    
    </>
);
}

export default App;
